Forget Me Not (2009)  

Verenigde Staten
Horror / Thriller

geregisseerd door Tyler Oliver
met Carly Schroeder, Cody Linley en Brie Gabrielle

Sandy Channing is een populair meisje op haar school, waar ze ook klassenvoorzitster is. Ze zou van de tijd van haar leven moeten genieten, alleen gebeurt dat niet als al haar vrienden plotseling verdwijnen. Sandy ontdekt dat haar vrienden de wraakzuchtige geest van het meisje hebben gewekt, die ze een tijd geleden onrecht hadden aangedaan.


